import * as React from 'react';
import Avatar from '@mui/material/Avatar';

export default function MyData(props){
    return(
        <div>
            <Avatar
                alt="Remy Sharp"
                src="/static/images/avatar/1.jpg"
                sx={{ width: 56, height: 56 }}
            />
        </div>
    );
}
